import React from "react";
import "./HomepageStyle.css";

function Homepage() {
  return (
    <div>
      <h1>
        Lost and Found is a website where you declare your lost pet or that you
        found a missing pet.
      </h1>
      <h2> Help us to find your pet!</h2>
      <div className="bg" />
    </div>
  );
}
export default Homepage;
